import React from 'react'
import styled from 'styled-components';
export default function Details() {
    return (
        <Background>
            <Text><TextDetails>Details</TextDetails>
            <MoNo>Mo.No</MoNo>
            <Occupation>Occupation</Occupation>
            <Location>Location</Location>
            <Achievement>Achievment</Achievement>
            </Text>
        </Background>
    )
}
const Background= styled.div
`
position: absolute;
width: 601px;
height: 484px;

background: red;
`
const Text= styled.div
`
font-family: Poppins;
font-style: normal;
font-weight: 500;
font-size: 16px;
line-height: 24px;
/* identical to box height */


color: #000000;
`
const TextDetails= styled.div
`
position: absolute;
width: 55px;
height: 24px;
top: 42px;
left: 273px;
`
const MoNo= styled.div
`
position: absolute;
width: 50px;
height: 24px;
top: 112px;
left: 88px;
`
const Occupation= styled.div
`
position: absolute;
top: 164px;
left: 88px;

`
const Location= styled.div
`
position: absolute;
top: 218px;
left: 88px;
`
const Achievement= styled.div
`
position: absolute;
top: 270px;
left: 88px;

`
